import {
  Button,
  Card,
  makeStyles,
  TextField,
  Typography,
} from "@material-ui/core";
import Rating from "@material-ui/lab/Rating";
import React from "react";

const useStyles = makeStyles((theme) => ({
  content: {
    width: "100%",
    boxSizing: "border-box",
    margin: theme.spacing(7),
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(1),
    display: "flex",
    flexDirection: "column",

    [theme.breakpoints.down("md")]: {
      margin: theme.spacing(7),
      width: "100%",
    },

    [theme.breakpoints.down("sm")]: {
      margin: theme.spacing(2),
    },
  },
  heading: {
    textAlign: "center",
    color: theme.palette.primary.main,
    fontWeight: "bold",
    fontSize: "1.5rem",
    marginBottom: theme.spacing(4),
  },
  ratingFeedbackHead: {
    padding: theme.spacing(1),
    color: theme.palette.primary.main,
  },
  ratingFeedbackCard: {
    padding: theme.spacing(4),
    margin: theme.spacing(1),
    boxSizing: "border-box",
    boxShadow: "none",
    border: `1px solid ${theme.palette.primary.light}`,
    width: "98.5%",
    [theme.breakpoints.down("xs")]: {
      width: "95%",
      padding: theme.spacing(3),
    },
  },
  ratingHeading: {
    fontSize: "14px",
    marginBottom: theme.spacing(1),
    fontWeight: "bold",
    color: theme.palette.dark.main,
  },
  ratingStars: {
    transform: "scale(1.5)",
  },
  feedbackHeading: {
    color: theme.palette.dark.main,
    fontSize: "14px",
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    fontWeight: "bold",
  },
  submitBtn: {
    marginTop: theme.spacing(2),
    backgroundImage: `linear-gradient(95.47deg, ${theme.palette.secondary.main} 0%,  ${theme.palette.primary.main} 100%)`,
    color: theme.palette.light.main,
    paddingRight: theme.spacing(2),
    paddingLeft: theme.spacing(2),
  },
  ratingsFeedbacksHeading: {
    marginTop: theme.spacing(4),
    padding: theme.spacing(1),
    color: theme.palette.primary.main,
  },
  ratingsFeedbacksContainer: {
    maxWidth: "100%",
    display: "flex",
    flexWrap: "wrap",
  },
  feedbackCard: {
    flexGrow: 1,
    width: "300px",
    minHeight: "200px",
    boxShadow: "none",
    margin: theme.spacing(1),
    padding: theme.spacing(4),
    border: `1px solid ${theme.palette.primary.light}`,
  },
  cardName: {
    fontSize: "16px",
    fontWeight: "bold",
    color: theme.palette.primary.main,
  },
  cardRating: {
    marginTop: theme.spacing(1),
  },
  cardFeedback: {
    marginTop: theme.spacing(1),
  },
  cardTag: {
    display: "inline-block",
    fontWeight: "bold",
    fontFamily: "Cookie, cursive",
    fontSize: "20px",
    marginTop: theme.spacing(2),
    backgroundImage: `linear-gradient(45deg, ${theme.palette.primary.main}, ${theme.palette.secondary.main})`,
    backgroundSize: "100%",
    WebkitBackgroundClip: "text",
    MozBackgroundClip: "text",
    WebkitTextFillColor: "transparent",
    MozTextFillColor: "transparent",
  },
}));

function RatingFeedback() {
  const classes = useStyles();

  return (
    <div className={classes.content}>
      <Typography variant="h6" component={"h1"} className={classes.heading}>
        RATINGS AND FEEDBACKS
      </Typography>
      <Typography
        variant="h6"
        component={"h2"}
        className={classes.ratingFeedbackHead}
      >
        Your Feedback
      </Typography>
      <Card className={classes.ratingFeedbackCard}>
        <Typography
          variant="h6"
          component={"h6"}
          className={classes.ratingHeading}
        >
          Please Rate Us
        </Typography>
        <Rating name="simple-controlled" size="large" />
        <Typography
          variant="h6"
          component={"h6"}
          className={classes.feedbackHeading}
        >
          Please Provide Feedback
        </Typography>
        <TextField
          label={"Feedback"}
          variant={"outlined"}
          multiline
          fullWidth
          rows={8}
          InputLabelProps={{ shrink: true }}
        />
        <Button className={classes.submitBtn}>Submit Feedback</Button>
      </Card>
      <Typography
        variant="h6"
        component={"h2"}
        className={classes.ratingsFeedbacksHeading}
      >
        Other People Feedbacks
      </Typography>
      <div className={classes.ratingsFeedbacksContainer}>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Muhammad Yousaf
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Junaid Akram
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Muhammad Asif
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            John William
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Imran Ali
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
      </div>
    </div>
  );
}

export default RatingFeedback;
